import React from 'react';

const RecruiterDashboard = () => (
  <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
    <h1 className="text-2xl sm:text-3xl font-bold text-secondary-900 mb-8">Recruiter Dashboard</h1>
    <div className="card p-6">
      <p>Recruiters can view eligible students, schedule interviews, and manage the hiring process.</p>
    </div>
  </div>
);

export default RecruiterDashboard;
